    false,nt"url": null,nt"notes": "This annual narrative report for Bowdoin
    NWR outlines Refuge accomplishments from July of 1974 to June of 1975. The report
    begins by summarizing the weather conditions, habitat conditions, water conditions,
    and food and cover conditions during the year. Wildlife- including migratory birds,
    upland game birds, big game animals, furbearers, predators, rodents, mammals, raptors,
    fish, reptiles, and diseases- is also covered. The Refuge development and maintenance
    section discusses physical developments and plantings. Resource management is outlined;
    topics include grazing and fur harvesting. A progress report on field investigations
    and applied research is also provided. The public relations section of the report
    describes recreational uses and safety. Photographs are attached.",nt"license_title":
